import React from "react";
import ReactDom from "react-dom";
import App from './App';
import Sdata from './Sdata';

ReactDom.render(
<>
  <h1>List of top 5 Netflix series in 2021</h1>

  <App 
    sname={Sdata[0].sname}
    title={Sdata[0].title}
    imgsrc={Sdata[0].imgsrc}  
    link={Sdata[0].link}
  />
  <App 
    sname={Sdata[1].sname}
    title={Sdata[1].title}
    imgsrc={Sdata[1].imgsrc}  
    link={Sdata[1].link}
  />
  <App 
    sname={Sdata[2].sname}
    title={Sdata[2].title}
    imgsrc={Sdata[2].imgsrc}  
    link={Sdata[2].link}
  />
  <App 
    sname={Sdata[3].sname}
    title={Sdata[3].title}
    imgsrc={Sdata[3].imgsrc}  
    link={Sdata[3].link}
  />
  <App 
    sname={Sdata[4].sname}
    title={Sdata[4].title}
    imgsrc={Sdata[4].imgsrc}  
    link={Sdata[4].link}
  />
</>
,
 document.getElementById("root")
 );
